DROP DATABASE IF EXISTS shop_reviews;

CREATE DATABASE shop_reviews;

USE shop_reviews;

create table users (
	id INT NOT NULL AUTO_INCREMENT,
	username VARCHAR(50),
	img_url VARCHAR(100),
	PRIMARY KEY (id)
);

create table shops (
	id INT,
	shop VARCHAR(50)
);

create table products (
	id INT,
	product VARCHAR(50),
	img_url VARCHAR(100),
	shop_id INT
);

create table reviews (
	id INT AUTO_INCREMENT,
	user_id INT,
	product_id INT,
	date_submitted VARCHAR(15),
	rating INT,
	review TEXT,
	votes INT,
	helpfulness INT,
	shop_id INT,
	PRIMARY KEY (id)
);
